import React from 'react'
import "./form.css"


export default class App extends React.Component {
    render() {
        return (
            <div className="form-wrapper col">
                <form action="/login" method="POST">
                    <input onChange={e => this.props.onChange(e)} type="email" name="email" value={this.props.values.email} placeholder="Email..." />
                    <input onChange={e => this.props.onChange(e)} type="password" name="password" value={this.props.values.password} placeholder="Password..." />
                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}
